import React from "react";

const Box = props => {
  return (
    <div className="container">
      <div className="row">
        {props.essai.map(myCard => {
          return (
            <div
              key={myCard.id}
              className="card col-lg-4 d-flex justify-content-center "
              style={{ width: "18rem" }}
            >
              <img className="card-img-top" src={myCard.img} alt="ok" />
              <div className="card-body ">
                <h3 className="fw-bold">{myCard.title}</h3>
                <p className="card-text">{myCard.paragraphe}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Box;
